window.bookSummaryJSON = "<p>A one-of-a-kind audio collection of five bestselling standalone romances performed by a full cast or in duet!</p> <p>This is a collection like no other – all five romances are full cast or duet so grab this extra special box set with performances from your favorite narrators including Andi Arndt, Sebastian York, Shane East and Vanessa Edwin! In Love in Duet you’ll get a falling for my best friend’s ex workplace romance in Birthday Suit, a friends-to-lovers/I-need-a-date-for-a-wedding romance in Instant Gratification, a marriage of convenience in Part-Time Lover, a fake fiancé romance in Dear Sexy Ex-Boyfriend, and an oops-he’s-my-boss romance in The What If Guy!</p> <p>These five standalones are specially curated for your binge-reading pleasure!</p> <p>Tropes: Friends to lovers, workplace romance, forbidden romance, best friend's sister, marriage of convenience, best friend’s ex, office romance, and fake fiancé</p>"; 
